import React from "react";

import {
    CssClasses
} 
from "../utilities";

const previewer = props => {
    const classes = new CssClasses(
        "bg-light", 
    )

    return (
        <div className={classes.toString()}>
            {props.children}
        </div>
    );
}
export default previewer;
